import React from 'react'
import {FcLike} from "react-icons"
function Card(props) {
  let course = props.course;
  return (
    <div>
      <div>
        <img src={course.image.url}></img>
      </div>

      <div>
        <button></button>
      </div>
    </div>
  )
}

export default Card
